CREATE PROCEDURE dbo.proc_transform_163
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_163
    SET payload = LEFT(payload, 1000) + N'|V4-163|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_163;
END
